// src/PMAlerts.ts
import { Plugin } from "@ryelite/core";
import { SettingsTypes } from "@ryelite/core";
import { NotificationManager } from "@ryelite/core";
import { SoundManager } from "@ryelite/core";

// resources/sounds/pm_alert.mp3
var pm_alert_default = "data:audio/mpeg;base64,";

// src/PMAlerts.ts
var PMAlerts = class extends Plugin {
  constructor() {
    super();
    this.pluginName = "PM Alerts";
    this.author = "Highlite";
    this.notificationManager = new NotificationManager();
    this.soundManager = new SoundManager();
    this.settings.volume = {
      text: "Volume",
      type: SettingsTypes.range,
      value: 50,
      min: 0,
      max: 100,
      callback: () => {
      }
      //TODO
    };
    this.settings.notification = {
      text: "Notification",
      type: SettingsTypes.checkbox,
      value: false,
      callback: () => {
      }
      //TODO
    };
    this.settings.sound = {
      text: "Sound",
      type: SettingsTypes.checkbox,
      value: true,
      callback: () => {
      }
      //TODO
    };
  }
  start() {
    this.log("Started");
  }
  stop() {
    this.log("Stopped");
  }
  init() {
    this.log("Initialized");
  }
  // a is the username of the sender
  // e is the type of message, "From" or "To"
  // h is the message content (Filtered)
  // i is the message content as well? (No Filter)
  // l is 4?
  // n is 0
  // o is 0 (2 logged in/logged out)
  // r is true
  // s is false
  // t is true
  PrivateChatMessageList_addChatMessage(a, e, h, i, l, n, o, r, s, t) {
    if (e && e === "From") {
      if (this.settings.notification.value) {
        this.notificationManager.createNotification(`You have recieved a private message from ${a}`);
      }
      if (this.settings.sound.value) {
        this.soundManager.playSound(
          pm_alert_default,
          this.settings.volume.value / 100
        );
      }
    }
  }
};
export {
  PMAlerts as default
};
